import "./style/signup.css";
import axios from 'axios';
import React, { useState } from "react";

function RegistrationForm() {
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("")
  const [funds, setFunds] = useState("")

  const handleSubmit = async (event) => {
    event.preventDefault();

    const user = { name, email, password, funds };

    try {
      const response = await axios.post('/api/users', user);
      console.log(response.data);
      // Do something with the response, e.g. show a success message
    } catch (error) {
      console.error(error);
      // Do something with the error, e.g. show an error message
    }
  };

  return (
    <div className="hero-image">
      <div className="form-container">
        <form onSubmit={handleSubmit}>
          <label htmlFor="name">Username</label>
          <input
            type="text"
            id="name"
            name="name"
            value={name}
            onChange={(event) => setName(event.target.value)}
          />

          <label htmlFor="email">Email Address</label>
          <input
            type="email"
            id="email"
            name="email"
            value={email}
            onChange={(event) => setEmail(event.target.value)}
          />

          <label htmlFor="password">Password</label>
          <input
            type="password"
            id="password"
            name="password"
            value={password}
            onChange={(event) => setPassword(event.target.value)}
          />
          <label htmlFor="funds">Add funds</label>
          <input
            type="number"
            min = '0'
            id="funds"
            name="funds"
            value={funds}
            onChange={(event) => setFunds(event.target.value)}
          />

          <button type="submit">Submit</button>
        </form>
        <Link to="/" className="back-to-landing-page">Back to landing page</Link>
      </div>
    </div>
  );
}

export default RegistrationForm;
